import {Grid, IconButton, Link,Paper, List, ListItem, ListItemIcon ,ListItemText} from "@material-ui/core";
import {FacebookIcon} from "@material-ui/icons/Facebook";
export default function Footer(){
    return(
        <div>
            <Paper>
                <List>
                    <ListItem>
                        <Link href='/'>Home</Link>
                    </ListItem>
                    <ListItem>
                        <Link href='/about'>About</Link>
                    </ListItem>
                    <ListItem>
                        <Link href='/contact'>Contact</Link>
                    </ListItem>
                </List>
            </Paper>
        </div>
    );
}
